import { motion } from "framer-motion"

const Skills = () => {
    return (
        <motion.div 
        className="container"
        initial={{opactity: 0}}
        animate={{opactiy: 1}}
        exit={{opacity: 0}}
        >
            <h2>Javascript, React, Python, MongoDB, PostgresQL, Express, NodeJS, </h2>
        </motion.div>
    )
}

export default Skills
